import React, { Component } from "react";
import Navbar from "./components/navbar/navbar";
import "./App.css";
import background from "./photos/index/WBC_7095.jpg";

class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <Navbar />
        <div id="imageContainer">
          <div id="backgroundImage"></div>
        </div>
      </div>
    );
  }
}

export default App;
